import { Outlet, Link } from "react-router-dom";
import styled from "styled-components";
import LinkComponent from "../components/LinkComponent";

export const LeftPanelStyle = styled.div`
    text-align: left;
    background-color: #424242;
    position: relative;
    width: 20%;
    min-height: 100vh;
    height: 100%;
    float: left;
`;

const Layout = () => {
    return (
        <LeftPanelStyle>
            <nav>
                <ul>
                    <li>
                        <LinkComponent to="/Welcome" className="menu-link">
                            Welcome
                        </LinkComponent>
                    </li>
                    <li>
                        <LinkComponent to="/AboutMe" className="menu-link">
                            About Me
                        </LinkComponent>
                    </li>
                    <li>
                        <LinkComponent to="/Blog" className="menu-link">
                            Blog
                        </LinkComponent>
                    </li>
                    <li>
                        <LinkComponent to="/Welcome" className="menu-link">
                            Welcome
                        </LinkComponent>
                        <Link to="/Contact">Contact</Link>
                    </li>
                </ul>
            </nav>
            <Outlet />
        </LeftPanelStyle>
    );
};

export default Layout;
